//----nancy add 0328-----------
function init(evt)
{
	var svgDoc = evt.target.ownerDocument ;
	var Layerid;
	var index;

	for(var i=0; i < 8 ; i++)
	{
		index = i + 1;
		Layerid = "layer" + index;
		svgDoc.rootElement.getElementById(Layerid).style.setProperty("visibility", "hidden");
	}
}


function onOverPolygon(evt, color)
{
	evt.target.setAttribute("fill",color);
	evt.target.setAttribute("fill-opacity","0.5");
	//alert(evt.getTarget.getAttribute("d"));
	var childs = evt.target.parentNode.childNodes;
	if (childs.length != 0){
		for (var i=childs.length-1; i>=0; i--){
			var c = childs.item(i);
			if (c.nodeName == "path"){
				if(c != evt.target){
					c.setAttribute("fill-opacity","1");
					c.setAttribute("fill","white");
				}
			}
		}
	}

}
